import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <nav>
      <Link to="/">
              <img src="/images/logo.png" alt="logo" />
              <span></span>
      </Link>
    </nav>
  );
};

export default Navigation;
